   return (
      <div className={style.cards}>{
            characters.map(({id,name,species,gender,image,origin,status})=>{
                  return (
                     <div>
                        function Detail({ id,name,image,species,gender,origin,status}) {
    (
      <div className={style.card}>


            <img src={image} alt='Img' />
            <h2>
            <NavLink to={`/`}>Nombre: {name}</NavLink>
            </h2>
            <h2>Especie: {species}</h2>
            <h2>Genero: {gender}</h2>
            <h2>Origen: {origin}</h2>
            <h2>Status: {status}</h2>

      </div>
   )
}

                     </div>
                  )
               }
            )
         }
      </div>
   );
}
